	/**
	 * Returns all keywords of the grammar. This includes all literals for boolean and
	 * enumeration terminals.
	 */
	public java.util.Set<String> getKeywords() {
		if (this.keywords == null) {
			this.keywords = new java.util.LinkedHashSet<String>();
			for (org.sintef.thingml.resource.thingml.grammar.ThingmlRule rule : RULES) {
				findKeywords(rule, this.keywords);
			}
		}
		return keywords;
	}
	
	/**
	 * Finds all keywords in the given element and its children and adds them to the
	 * set. This includes all literals for boolean and enumeration terminals.
	 */
	private void findKeywords(org.sintef.thingml.resource.thingml.grammar.ThingmlSyntaxElement element, java.util.Set<String> keywords) {
		if (element instanceof org.sintef.thingml.resource.thingml.grammar.ThingmlKeyword) {
			keywords.add(((org.sintef.thingml.resource.thingml.grammar.ThingmlKeyword) element).getValue());
		} else if (element instanceof org.sintef.thingml.resource.thingml.grammar.ThingmlBooleanTerminal) {
			keywords.add(((org.sintef.thingml.resource.thingml.grammar.ThingmlBooleanTerminal) element).getTrueLiteral());
			keywords.add(((org.sintef.thingml.resource.thingml.grammar.ThingmlBooleanTerminal) element).getFalseLiteral());
		} else if (element instanceof org.sintef.thingml.resource.thingml.grammar.ThingmlEnumerationTerminal) {
			org.sintef.thingml.resource.thingml.grammar.ThingmlEnumerationTerminal terminal = (org.sintef.thingml.resource.thingml.grammar.ThingmlEnumerationTerminal) element;
			for (String key : terminal.getLiteralMapping().keySet()) {
				keywords.add(key);
			}
		}
		for (org.sintef.thingml.resource.thingml.grammar.ThingmlSyntaxElement child : element.getChildren()) {
			findKeywords(child, this.keywords);
		}
	}
	
